import { ContextGlobal } from "./Components/utils/global.context";
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";

function App() {
  return (
    <div className="App">
      <ContextGlobal.Provider>
        <Navbar />
        <Footer />
      </ContextGlobal.Provider>
    </div>
  );
}

export default App;
